import { getAuth, signOut, } from "firebase/auth";
import { useNavigate } from "react-router-dom";
import "./app.css"
function Main() {

    const navigate = useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()
    const submitData = (event) => {
        event.preventDefault()


        signOut(auth)
            .then(() => {
                alert("Logout successfull")
                navigate("/Login")
            })
            .catch(() => {
                alert("error")
            })

    }

    return (




        <div id="nav">
            <ul >
                <li>  <img src="https://cdn-icons-png.flaticon.com/512/146/146940.png" style={{ width: "70px", borderRadius: "20px" }}></img></li>
                <li id="mob">  <b>BOOK_STALL</b></li>
                <li >
                    <form >
                        <input type="search" placeholder="Search" id="search" ></input>
                        <button class="btn btn-outline-success" type="submit">Search</button>
                    </form>
                </li>
                <li >  <p id="bell"><i style={{ fontSize: "30px", border: "2px solid black", borderRadius: "50% ", padding: "10px", cursor: "pointer" }} class="fa-solid fa-bell"></i></p>
                </li>
                <li >
                    <form id="log" onSubmit={submitData}>
                        <button type="submit" class="btn btn-danger">Logout</button>
                    </form>
                </li>

            </ul>



            <div class="grid text-center">
  <div class="g-col-6 g-col-md-4">.g-col-6 .g-col-md-4</div>
  <div class="g-col-6 g-col-md-4">.g-col-6 .g-col-md-4</div>
  <div class="g-col-6 g-col-md-4">.g-col-6 .g-col-md-4</div>
  <div class="g-col-6 g-col-md-4">tfygvubhinjokml</div>
</div>





        </div>







































